CREATE DEFINER=`skatapp`@`localhost` PROCEDURE `sp_abrechnung_update`(IN `in_serien_id` BIGINT)
BEGIN

SET @serien_id = in_serien_id;

DELETE FROM abrechnung
WHERE serien_id = @serien_id
;

INSERT INTO abrechnung
SELECT 
M.serien_id, 
M.spieler, 
M.punkte,
SUM(M.betragspunkte) As betragspunkte, 
SUM(M.betragspunkte) * M.einsatz As betrag,
LEAST(GREATEST(SUM(M.betragspunkte) * M.einsatz, -1 * M.max_loss),0) As payout

FROM (
SELECT A.serien_id, A.spieler, A.punkte, A.punkte - B.punkte As betragspunkte , A.einsatz as einsatz, A.max_loss as max_loss
	FROM 
		( 
		SELECT v.serien_id, v.spieler, v.einsatz as einsatz, v.max_loss as max_loss, SUM(v.punkte) as punkte
		FROM vw_punkte v 
		WHERE v.serien_id = @serien_id AND NOT v.einsatz IS NULL
		GROUP BY serien_id, spieler, einsatz, max_loss 
		) As A
	INNER JOIN
		( SELECT serien_id, spieler, SUM(punkte) as punkte
		FROM vw_punkte GROUP BY serien_id, spieler ) As B
	ON A.serien_id = B.serien_id AND A.spieler <> B.spieler
) As M

GROUP BY M.serien_id, M.spieler
;


END ;;
