    punkte
WHERE
    spiel_id = p_spiel_id;

INSERT INTO
    punkte (spiel_id, spieler, punkte, punktetyp)
SELECT
    main.*
FROM
    (
        SELECT
            s.id as spiel_id,
            n.spieler,
            case
                when s.spieler = n.spieler then greatest(
                    case
                        when s.grundspiel = 'Ramsch' then sz.ramsch_max
                        else -9999
                    end,
                    case
                        when t.punktetyp = 'Basis' then case
                            when s.`status` = 'G' then 1
                            else -1
                        end * case
                            when s.grundspiel = 'Ramsch' then s.augen
