                            when s.grundspiel = 'Ramsch' then 0
                            when s.`status` = 'G' then 50
                            else -50
                        end
                    end
                )
                else case
                    when t.punktetyp = 'Basis' then 0
                    else case
                        when t.punktetyp = 'Seeger-Fabian' then case
                            when s.grundspiel = 'Ramsch' then 0
                            when s.`status` = 'V' then 40
                            else 0
                        end
                        else 0
                    end
                end
            end as punkte,
            t.punktetyp
        FROM
            spiele s
            LEFT JOIN serien sn on sn.id = s.serie_id
            LEFT JOIN spielzeiten sz on sz.id = sn.spielzeit
            LEFT JOIN spielwerte w ON w.grundspiel = s.grundspiel
            and w.gewinnstufe = s.gewinnstufe
            and w.spitzen = s.spitzen,
            (
                SELECT
                    spieler
                from
                    (
                        SELECT
                            id,
                            spieler1 as spieler
                        from
                            serien
                        UNION
                        SELECT
                            id,
                            spieler2 as spieler
                        from
                            serien
                        UNION
                        SELECT
                            id,
                            spieler3 as spieler
                        from
                            serien
                    ) As n
                where
                    n.id = 1
            ) As n,
            (
                SELECT
                    'Basis' As punktetyp
                UNION
                SELECT
                    'Seeger-Fabian' As punktetyp
            ) As t
        WHERE
            s.id = p_spiel_id
    ) As main
WHERE
    main.punkte <> 0;
END ;;
DELIMITER ;
