CREATE DEFINER=`root`@`%` PROCEDURE `sp_spieler_chart_series`(IN `in_min_serie` int, IN `in_max_serie` int, IN `in_bock` varchar(50))
BEGIN

SET @minSerieID = in_min_serie;
SET @maxSerieID = in_max_serie;
SET @bock = in_bock;

SELECT
ROW_NUMBER() OVER (ORDER BY serie_id ASC, spielnummer ASC, a.spieler ASC) as idx
,a.*
, SUM(a.punkte) OVER(PARTITION BY a.spieler ORDER BY serie_id, a.spielnummer) As running_total
FROM 
(
	SELECT 
	p.serien_id as serie_id
	,s.spieler as spieler
    ,p.spiel_id
	,p.spielnummer as spielnummer
	,SUM(CASE WHEN p.spieler = s.spieler THEN p.punkte ELSE 0 END) as punkte 
	FROM vw_punkte p,
		(SELECT DISTINCT spieler FROM vw_punkte WHERE serien_id >= @minSerieID AND serien_id <= @maxSerieID) s
	WHERE 1=1
	AND p.serien_id >= @minSerieID
	AND p.serien_id <= @maxSerieID	
	AND p.spielnummer > 0
	AND (p.bock = @bock OR @bock = "Alle" OR p.bock IS NULL) 	

	GROUP BY
	p.serien_id ,
	p.spielnummer,
	s.spieler

	ORDER BY
	p.serien_id ,
	p.spielnummer ,
	s.spieler 
) a
ORDER BY
a.serie_id ASC, 
a.spielnummer ASC,
a.spieler ASC
;
END ;;
DELIMITER ;
