CREATE DEFINER=`skatapp`@`localhost` PROCEDURE `sp_stats_basic_calc`(IN `in_spielzeit` INT, IN `in_kpi` ENUM('grundspiel','gewinnstufe','spitzen'))
BEGIN



SET @spielzeit = in_spielzeit;
SET @KPI = in_kpi;





SELECT 
'WITH vw_stats_basic As ('
'SELECT `vsb`.`spielzeit` AS `spielzeit`, `vsb`.`@KPI@` AS `@KPI@`, `vsb`.`spieler` AS `spieler`, `vsb`.`status` AS `status`, sum(`vsb`.`anzahl`) AS `anzahl` from `skatliste`.`vw_stats_base` `vsb` group by `vsb`.`spielzeit`, `vsb`.`@KPI@`, `vsb`.`spieler`, `vsb`.`status` '
'UNION '
'SELECT `vsb`.`spielzeit` AS `spielzeit`, ''Farbspiel'' AS `@KPI@`, `vsb`.`spieler` AS `spieler`, `vsb`.`status` AS `status`, sum(`vsb`.`anzahl`) AS `anzahl` from `skatliste`.`vw_stats_base` `vsb` where `vsb`.`grundspiel` in (''Kreuz'', ''Pik'', ''Herz'', ''Karo'') AND ''grundspiel'' = ''@KPI@'' group by `vsb`.`spielzeit`, `vsb`.`spieler`, `vsb`.`status`'
')'
INTO @vw_stats_base_tmpl
;



SELECT 
'CONCAT('
'ROUND(100*'
    'SUM(CASE WHEN (vsg.spieler = ''@SPIELER@'' OR ''@SPIELER@'' = ''alle spieler'') and vsg.status = ''G'' THEN vsg.anzahl ELSE 0 END)'
    '/'
    'IF(SUM(CASE WHEN (vsg.spieler = ''@SPIELER@'' OR ''@SPIELER@'' = ''alle spieler'') THEN vsg.anzahl ELSE 0 END)=0, 1,'
        'SUM(CASE WHEN (vsg.spieler = ''@SPIELER@'' OR ''@SPIELER@'' = ''alle spieler'') THEN vsg.anzahl ELSE 0 END)'
'),1), ''% ' 
'('',' 
    'SUM(CASE WHEN (vsg.spieler = ''@SPIELER@'' OR ''@SPIELER@'' = ''alle spieler'') and vsg.status = ''G'' '
        'THEN vsg.anzahl ELSE 0 '
        'END), ''/'' ,' 
    'SUM(CASE WHEN (vsg.spieler = ''@SPIELER@'' OR ''@SPIELER@'' = ''alle spieler'') and vsg.status = ''V'' '
    'THEN vsg.anzahl ELSE 0 '
    'END), '        
''')'''
' ) as ''@SPIELER@'''
INTO @tmpl_spielerstat
;


SELECT 
' @with_vw_stats_basic@'
' SELECT' 
' @spielzeit as spielzeit,'
' vsg.@KPI@ as @KPI@,'
' @spielerstats@'
' FROM vw_stats_basic vsg' 
' WHERE (vsg.spielzeit = @spielzeit OR @spielzeit = 0)'
' GROUP BY vsg.@KPI@'
' ;'
INTO @sql_calc
;


SELECT
GROUP_CONCAT(DISTINCT REPLACE(@tmpl_spielerstat, '@SPIELER@', lower(spl.nick)))
INTO @spielerstats
FROM (
    SELECT 'alle spieler' as nick UNION ALL
    SELECT nick FROM spieler 
) spl 
;


SELECT REPLACE(REPLACE(REPLACE(	@sql_calc 
	,'@spielerstats@', @spielerstats)
	,'@with_vw_stats_basic@', @vw_stats_base_tmpl)
	, '@KPI@', @KPI ) 
INTO @sql_main_select
;


SELECT REPLACE(
	CONCAT('INSERT INTO stats_@KPI@ (spielzeit, @KPI@, `alle spieler`, `bernd`, `leif`, `miki`)', @sql_main_select)
	, '@KPI@', @kpi ) 
INTO @sql_main_insert
;


SELECT 
' DELETE FROM stats_@KPI@'
' WHERE spielzeit = @spielzeit'
INTO @del_temp
;
SELECT REPLACE(@del_temp, '@KPI@', @KPI) INTO @delstats
;

PREPARE stmtDelStats FROM @delstats;
EXECUTE stmtDelStats;
DEALLOCATE PREPARE stmtDelStats;


PREPARE stmtNewStats FROM @sql_main_insert;
EXECUTE stmtNewStats;
DEALLOCATE PREPARE stmtNewStats;


END ;;
DELIMITER ;
