CREATE DEFINER=`skatapp`@`localhost` PROCEDURE `sp_stats_consec_spiele_calc`(IN `in_spielzeit` INT)
BEGIN
	
SET @spielzeit = in_spielzeit
;

SELECT 
'INSERT INTO stats_consec_spiele' 
' SELECT  @spielzeit AS `Spielzeit`,'
'  		  vscs.`spiele` AS `Spiele`,'
'		  $tmpl_spieler'
' FROM `skatliste`.`vw_stats_consec_spiele` AS vscs'
' WHERE vscs.spielzeit = @spielzeit OR @spielzeit = 0'
' GROUP BY vscs.`spiele`'
' ORDER BY vscs.`spiele` DESC'
';'
INTO @sql_base
;
SELECT 
'    SUM(IFNULL(CASE WHEN vscs.`spieler` = ''$spieler'' THEN 1 END, 0)) AS `$spieler`'
INTO @tmpl_spieler
;

SELECT
GROUP_CONCAT(DISTINCT REPLACE(@tmpl_spieler, '$spieler', spl.nick ))
INTO @spielerstats
FROM spieler spl 
;

SELECT REPLACE(@sql_base, '$tmpl_spieler', @spielerstats)
INTO @sql_query
;


DELETE FROM stats_consec_spiele
WHERE spielzeit = @spielzeit
;


PREPARE stmt1 FROM @sql_query;
EXECUTE stmt1;
DEALLOCATE PREPARE stmt1;

END ;;
