INSERT INTO stats_consec_spiele_list SELECT spielzeit AS Spielzeit, spieler AS Spieler, spiele AS Spiele, datum AS Datum, start_spielnummer as `Lauf ab Spiel` FROM vw_stats_consec_spiele WHERE spielzeit = 1 ORDER BY spiele DESC LIMIT 30 ;
