	IN `in_spielzeit` INT,
	IN `in_statistik` ENUM('stats_grundspiel','stats_gewinnstufe','stats_spitzen','stats_consec_spiele','stats_consec_spiele_list')
)
BEGIN

SET @spielzeit = in_spielzeit;
SET @statistik = in_statistik;


SELECT
GROUP_CONCAT(COLUMN_NAME)
INTO @column_names
FROM
(
SELECT CONCAT('`', COLUMN_NAME,'`') as COLUMN_NAME
FROM `INFORMATION_SCHEMA`.`COLUMNS` 
WHERE `TABLE_SCHEMA`='skatliste' 
    AND `TABLE_NAME`= @statistik
	AND COLUMN_NAME <> 'Spielzeit'
) cols
;


SELECT
REPLACE(REPLACE(
'SELECT $column_names'
' FROM $stats'
' WHERE spielzeit = @spielzeit'
';'
, '$column_names', @column_names)
, '$stats', @statistik)
INTO @sql_query
;


