CREATE DEFINER=`skatapp`@`172.%` PROCEDURE `sp_tabelle_ranking`(
	IN `in_spielzeit` INT,
	IN `in_serien_id` INT
)
BEGIN

SET @serien_id=in_serien_id;
SET @spielzeit=in_spielzeit;
SET @row_number=0;

SELECT 
(@row_number:=@row_number + 1) As Rang
, Liste.*
, Stats.`Grand`
, Stats.`Farb`
, Stats.`Null`
, Stats.`Ramsch`

FROM
(SELECT 
spieler as Spieler,
SUM(punkte) as Punkte,
SUM(betrag) as Betrag,
SUM(payout)*-1 as Payout,
SUM(gespielt) as Spiele,
SUM(gewonnen) as Gew,
SUM(verloren) as Verl,
CONCAT(CONVERT(FORMAT((SUM(gewonnen)/SUM(gespielt))*100,0), CHAR), "%") as Quote

FROM skatliste.vw_abrechnung
WHERE 
(serien_id = @serien_id OR @serien_id=0)
AND
(spielzeit = @spielzeit OR @spielzeit=0)
GROUP BY spieler
ORDER BY punkte DESC
) As Liste
LEFT JOIN
(
SELECT 
spieler
, CONVERT(CONCAT( SUM(case when grundspiel = 'Grand' AND `status` = 'G' then 1 ELSE 0 END), ' / ', SUM(case when grundspiel = 'Grand' AND `status` = 'V' then 1 ELSE 0 END)), CHAR) AS `Grand`
, CONVERT(CONCAT( SUM(case when not grundspiel IN ('Grand', 'Null') AND `status` = 'G' then 1 ELSE 0 END), ' / ', SUM(case when not grundspiel IN ('Grand', 'Null') AND `status` = 'V' then 1 ELSE 0 END)), CHAR) AS `Farb`
, CONVERT(CONCAT( SUM(case when grundspiel = 'Null' AND `status` = 'G' then 1 ELSE 0 END), ' / ', SUM(case when grundspiel = 'Null' AND `status` = 'V' then 1 ELSE 0 END)), CHAR) AS `Null`
, CONVERT(CONCAT( SUM(case when grundspiel = 'Ramsch' AND `status` = 'V' then 1 ELSE 0 END)), CHAR) AS `Ramsch`
FROM spiele
WHERE 
(serie_id = @serien_id OR @serien_id=0)

GROUP BY 
spieler
) AS Stats
ON Stats.spieler = Liste.spieler


;
END ;;
DELIMITER ;
