CREATE DEFINER=`skatapp`@`localhost` PROCEDURE `sp_tabelle_serien`(IN `spielzeit` BIGINT, IN `in_valfield` ENUM('punkte','betrag','payout',''))
BEGIN

SET @val = in_valfield;

SET @sql_dynamic = (
	SELECT
		GROUP_CONCAT( DISTINCT
			CONCAT(
				'SUM( IF(spieler = '''
				, spieler
				, ''', ', @val, ',0) ) AS '
				, spieler
			)
		)
	FROM vw_abrechnung
);

SET @sql_drop = CONCAT('DROP TABLE IF EXISTS tmp_', @val, '; ');

SET @sql_create = CONCAT('CREATE TABLE tmp_', @val, ' SELECT datum as Datum, spielzeit as Spielzeit, serie as Spielliste, MAX(spiele) As Spiele,', 
 				  @sql_dynamic, ' FROM vw_abrechnung WHERE spielzeit=',spielzeit,' OR 0=', spielzeit, ' GROUP BY datum, serie ORDER BY datum DESC, serie ASC; '
 	   );	  
	  
SET @sql_select = CONCAT('SELECT * FROM tmp_', @val, ' ORDER BY Datum Desc, Spielliste Desc;');




