CREATE DEFINER=`skatapp`@`172.%` PROCEDURE `sp_tabelle_spielliste`(
	IN `in_serien_id` BIGINT
)
BEGIN

SET @serien_id = in_serien_id;

SET @sql_drop = CONCAT('DROP TABLE IF EXISTS tmp_spielliste_', @serien_id, '; ');


SET @sql_dyn_spieler = (
	SELECT
		GROUP_CONCAT( DISTINCT
			REPLACE(
				'IF(spieler = ''$spieler'', @rt$spieler:= @rt$spieler+punkte,'''') AS $spieler'
				, '$spieler'
				, spieler
			)
		ORDER BY spieler_prio
		)
	FROM vw_punkte
	WHERE serien_id = @serien_id
	ORDER BY spieler_prio ASC
);


SET @sql_dyn_rt = (
	SELECT CONCAT (', (SELECT ',
		GROUP_CONCAT( DISTINCT
			REPLACE(
				'@rt$spieler:=0'
				, '$spieler'
				, spieler
			)

		),
		') r'
		)
	FROM vw_punkte
	WHERE serien_id = @serien_id
);

SET @sql_select = ' select spielnummer as Nr, grundspiel as Spiel, spitzen as Spitzen, gewinnstufe as Stufe, bock as Bock, kontra as Kontra, re as Re, spieler as Spieler, status as Status,  augen as Augen,  punkte as Punkte';

IF @sql_dyn_spieler Is Null THEN
	SET @sql_create = CONCAT('create temporary table tmp_spielliste_', @serien_id,
														@sql_select, ' from vw_punkte where serien_id = ', @serien_id, ' and spiel_id > 0;');
ELSE
	SET @sql_create = CONCAT('create temporary table tmp_spielliste_', @serien_id, 
						@sql_select, ' ,',
					  @sql_dyn_spieler,
					  ' from vw_punkte ',
					  @sql_dyn_rt, 
						' where punktetyp = ''Basis'' and serien_id = @serien_id and spiel_id > 0 order by spielnummer ASC '
						);
END IF;

SET @sql_select = CONCAT('SELECT * FROM tmp_spielliste_', @serien_id, ' order by Nr ASC;');



PREPARE stmt_drop FROM @sql_drop; EXECUTE stmt_drop; DEALLOCATE PREPARE stmt_drop;
PREPARE stmt_create FROM @sql_create; EXECUTE stmt_create; DEALLOCATE PREPARE stmt_create;
PREPARE stmt_select FROM @sql_select; EXECUTE stmt_select; DEALLOCATE PREPARE stmt_select;


END ;;
